local function KaizoXYZExtension()
	local self = {
		version = "1.0.0",
		name = "Kaizo XYZ",
		author = "Kuroe",
		description = "Extension that allows for compatibility with the Fire Red Kaizo XYZ ROM hack.",
		github = "rdpic/kaizoplus", -- Replace "MyUsername" and "ExtensionRepo" to match your GitHub repo url, if any

		requiredVersion = "v8.5.0", -- minimum Tracker version required to use this extension with full support
		extensionKey = "KaizoXYZExtension", -- matches the name of this file, used for enabling/disabling this extension
    	isKaizoXYZ = false, -- a stored verification check if this game rom is a kaizo xyz game rom
		allowWarningPopup = true, -- if tracker doesn't support this extension, popup a warning
		monCountAddress = 0x08000170,
	}
	self.url = string.format("https://github.com/%s", self.github or "")

	self.Paths = {
		RandomizerSettings = {
			folderNames = { "kaizoxyz", "rnqs_files", }, -- ordered; to create the folder path
			fileType = ".rnqs",
			builtPath = "/",  -- path to randomizer settings files, built later in startup()
		},
		PokemonSprites = {
			folderNames = { "kaizoxyz", "sprites_mons", }, -- ordered; to create the folder path
			fileType = ".png",
			builtPath = "/",  -- path to new kaizo xyz "pokemon" icon sprites, built later in startup()
		},
		TypeSprites = {
			folderNames = { "kaizoxyz", "sprites_types", }, -- ordered; to create the folder path
			fileType = ".png",
			builtPath = "/",  -- path to new kaizo xyz "type" icon sprites, built later in startup()
		},
	}

	-- local DEBUG_MESSAGES_ON = false
	
	-- Returns true if the loaded game rom is a Kaizo XYZ game rom
	function self.checkIfKaizoXYZROM()
		local kaizoXYZMonCount = Memory.read32(self.monCountAddress)
		return (kaizoXYZMonCount == 737)
    end

	function self.buildExtensionPaths()
		-- Build file/folder paths to custom images and other resources
		for _, pathTable in pairs(self.Paths or {}) do
			local folderPath = table.concat(pathTable.folderNames or {}, FileManager.slash)
			pathTable.builtPath = FileManager.getCustomFolderPath() .. folderPath .. FileManager.slash
		end
	end

	function self.overrideTrackerSettings()
		-- Force using the gen7+ icon set
		self.currIconSet = tonumber(Options["Pokemon icon set"]) or 1
		Options.addUpdateSetting("Pokemon icon set", 3) -- gen 7+

		-- Change Log Viewer Pokemon display names to use Tracker-defined data instead
		self.currNamesFromLogSetting = RandomizerLog.Settings.UsePokemonNamesFromLog
		RandomizerLog.Settings.UsePokemonNamesFromLog = false
	end

	function self.undoOverrideTrackerSettings()
		if self.currIconSet ~= nil then
			Options.addUpdateSetting("Pokemon icon set", self.currIconSet)
			if Options.getIconSet().isAnimated then
				SpriteData.changeIconSet(self.currIconSet)
			end
		end
		if self.currNamesFromLogSetting ~= nil then
			RandomizerLog.Settings.UsePokemonNamesFromLog = self.currNamesFromLogSetting
		end
	end

	function self.overrideCoreTrackerFunctions()
		self.currentGetRandomizerSettingsPath = FileManager.getRandomizerSettingsPath
		FileManager.getRandomizerSettingsPath = self.overrideGetRandomizerSettingsPath
	end

	function self.undoOverrideCoreTrackerFunctions()
		if type(self.currentGetRandomizerSettingsPath) == "function" then
			FileManager.getRandomizerSettingsPath = self.currentGetRandomizerSettingsPath
		end
	end

	function self.overrideGetRandomizerSettingsPath()
		return self.Paths.RandomizerSettings.builtPath or "/"
	end

	function self.addUpdateNewData()
		-- Add new Kaizo XYZ data
		self.addNewEvoStones()
		self.addNewEvoDetails()
		self.addNewPokemonData()
		self.addNewMoves()
		self.addNewAbilities()
		self.addNewTypes()
		self.addNewSprites()
		self.addResources()

		-- Update existing data to Kaizo XYZ
		self.updateResources()
		self.updatePokeData()
		self.updateMoveData()
		self.updateAbilityData()
		self.updateAddresses()
		self.updateOffsets()

		-- Rebuild the Tracker's data objects
		PokemonData.buildData(true)
		MoveData.buildData(true)
		AbilityData.buildData(true)

		-- update resources for Tracker's data objects
		PokemonData.updateResources()
		MoveData.updateResources()
		AbilityData.updateResources()
		MiscData.updateResources()
	end

	-- INTERNAL TRACKER FUNCTIONS
	-- Executed only once: When the extension is enabled by the user, and/or when the Tracker first starts up, after it loads all other required files and code
	function self.startup()

        self.isKaizoXYZ = self.checkIfKaizoXYZROM()
        if not self.isKaizoXYZ then
			-- if DEBUG_MESSAGES_ON then
	        --     Utils.printDebug("\nKaizo XYZ ROM not detected. Extension disabled.")
			-- end
            return
		end

		-- if DEBUG_MESSAGES_ON then
		-- 	Utils.printDebug("\nKaizo XYZ ROM detected. Extension enabled.")
		-- end

		self.buildExtensionPaths()
		self.overrideTrackerSettings()
		self.overrideCoreTrackerFunctions()
		self.addUpdateNewData()
	end

	-- Executed only once: When the extension is disabled by the user, necessary to undo any customizations, if able
	function self.unload()
		if not self.isKaizoXYZ then
			return
		end

		self.undoOverrideTrackerSettings()
		self.undoOverrideCoreTrackerFunctions()

		-- Force tracker to refresh and reload its scripts, removing all Kaizo XYZ changes
		Main.forceRestart = true
	end

